import React, { useState } from "react";
import "../components/Contact.css";

const Contact = () => {
  const [formData, setFormData] = useState({
    issue: "",
    subject: "",
    message: "",
  });

  const [submitted, setSubmitted] = useState(false);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Wys≈Çano wiadomo≈õƒá:", formData);
    setSubmitted(true);
    setFormData({ issue: "", subject: "", message: "" });
  };

  return (
    <section
      className="contact-container"
      style={{
        backgroundImage: "url(/img/contact.jpg)",
        backgroundSize: "cover",
        backgroundPosition: "center",
        position: "relative",
        overflow: "hidden",
        color: "#5a5a5a",
        padding: "50px 10%",
      }}
    >
      {/* Przyciemnienie */}
      <div className="contact-bg"></div>

      <div className="contact-header">
        <h1>Kontakt</h1>
        <p>Skontaktuj siƒô z nami ‚Äî chƒôtnie pomo≈ºemy!</p>
      </div>

      <div className="contact-content">
        <div className="contact-info">
          <h2>Schronisko ‚ÄûPrzyjazna ≈Åapa‚Äù</h2>
          <p><strong>Adres:</strong> ul. Le≈õna 12, 00-123 Warszawa</p>
          <p><strong>Telefon:</strong> +48 555 123 456</p>
          <p><strong>Email:</strong> kontakt@przyjaznalapa.pl</p>
          <p><strong>Godziny otwarcia:</strong><br />
            Pon‚ÄìPt: 9:00‚Äì17:00<br />
            Sob: 10:00‚Äì14:00
          </p>
        </div>

        <div className="contact-form">
          <h2>Formularz kontaktowy</h2>

          {submitted ? (
            <div className="form-success">
              <p>Dziƒôkujemy! Twoja wiadomo≈õƒá zosta≈Ça wys≈Çana üêæ</p>
            </div>
          ) : (
            <form onSubmit={handleSubmit}>
              <label htmlFor="issue">Wybierz sprawƒô:</label>
              <select
                name="issue"
                id="issue"
                value={formData.issue}
                onChange={handleChange}
                required
              >
                <option value="">-- wybierz --</option>
                <option value="adopcja">Adopcja zwierzaka</option>
                <option value="wolontariat">Wolontariat</option>
                <option value="darowizna">Darowizna lub wsparcie</option>
                <option value="inne">Inna sprawa</option>
              </select>

              <label htmlFor="subject">Temat:</label>
              <input
                type="text"
                id="subject"
                name="subject"
                placeholder="Wpisz temat wiadomo≈õci"
                value={formData.subject}
                onChange={handleChange}
                required
              />

              <label htmlFor="message">Tre≈õƒá wiadomo≈õci:</label>
              <textarea
                id="message"
                name="message"
                rows="5"
                placeholder="Opisz swojƒÖ sprawƒô..."
                value={formData.message}
                onChange={handleChange}
                required
              ></textarea>

              <button type="submit">Wy≈õlij wiadomo≈õƒá</button>
            </form>
          )}
        </div>
      </div>
    </section>
  );
};

export default Contact;
